import React from 'react';
import s from './cost.module.css'

const Cost = (props) => {
    return (
        <div>
            <div>
                <p className={s.question}>Была ли ванна ранее чем-то покрыта?</p>
                <div className={s.answerBar}>
                    Выберете ответ:<br/><br/>
                <label for="answer_no" className={s.answerLabel}>Нет</label> <input type="radio" name="cover" value="no" id="answer_no"  checked="true"/> <br/> 
                <label for="answer_yes">Да</label>  <input type="radio" name="cover" value="yeas" id="answer_yes" />
                </div>
            </div>
        </div>
    )
}
export default Cost;
